const Room = () => {
    const [seatsList, setSeatsList] = useState([])

    useEffect(async () =>{
        const response = await Seats.getAllSeats();
        setSeatsList(response.data)
    },[])

    return(
        <div>
            <table>
            {seatsList.map(item => (
                Frame(item)
            ))}
            </table>
        </div>
    )
}


export default Room
